import './App.css';
import Navbar from './components/Navbar';
function App() {
  return (
    <BrowserRouter>
            <div className="App">

              <Navbar/>
                <Switch>
                    <Route exact path="/" component={Home}/>
                    <Route path="/cart" component={Cart}/>
                  </Switch>
             </div>
       </BrowserRouter>
  );
}

export default App;
